import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Button,
  Container,
  Form,
  Row,
  Col,
  FormGroup,
  Nav,
  NavItem
} from "react-bootstrap";
import "../../css/grubhub.css";

class OwnerSignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: true
    };
  }

  render() {
    return <div></div>;
  }
}
function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(OwnerSignUp);
